INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (45101, 20011, 'Diclofenac', 'Asthma', 'Nonsteroidal anti-inflammatory drugs (NSAIDs) are contraindicated in patients with history of asthma, urticaria, or other allergic-type reactions after taking aspirin or other NSAIDs; severe, sometimes fatal, anaphylactic reactions to NSAIDs have been reported in such patients.  A subpopulation of patients with asthma may have aspirin-sensitive asthma which may include chronic rhinosinusitis complicated by nasal polyps, severe potentially fatal bronchospasm, and/or intolerance to aspirin and other NSAIDs.  Since cross-reactivity between aspirin and other NSAIDs has been reported in such aspirin-sensitive patients, therapy with any NSAID should be avoided in patients with this form of aspirin sensitivity.  NSAIDs should be used with caution in patients with preexisting asthma (without known aspirin sensitivity), and these patients should be monitored for changes in the signs and symptoms of asthma.', '3', '', 'DDInter', 0);
